import React from "react";
import MyPastDialogs from "./MyPastDialogs/MyPastDialogs";
import "../Dialogs.css";
import {NavLink} from "react-router-dom";
import styles from "./Slider.module.css"

const Slider = (props) => {
    return (
        <div className="slider">
            <NavLink to="/Dialogs/1" className={styles.link}><MyPastDialogs pastDialogs="Гослинг Р."/></NavLink>
            <hr />
            <NavLink to="/Dialogs/2" className={styles.link}><MyPastDialogs pastDialogs="Лил П."/></NavLink>
            <hr />
            <NavLink to="/Dialogs/3" className={styles.link}><MyPastDialogs pastDialogs="Путин В."/></NavLink>
            <hr />
            <NavLink to="/Dialogs/4" className={styles.link}><MyPastDialogs pastDialogs="Кевин Д."/></NavLink>
            <hr />
        </div>

    );
}

export default Slider;
